import React from 'react';
import { NavLink } from 'react-router-dom/cjs/react-router-dom.min';

const Error = () => {
    return (
        <div>
            <h1>Oops 404 ! Error Page </h1>
            <p>Sorry, This page doesn't exist</p>
            <NavLink >Go Back</NavLink>
        </div>
        )
}
export default Error;
